import React from 'react'
import './findProductAndServives.css'
import ListIcon from '@material-ui/icons/List';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Gridpapers from './Gridpapers';

function FindProductAndServives() {
    const mystyle={
        color: "black",
        background: "white",
        borderRadius:"25%",
        fontSize:"20px"
    }


    return (
        <div className="fpas-container">
            <h1 className="HeadingText">Comparison Page</h1>
            <br/><br/>
          
            <p className="para"><ListIcon /> Overview</p>

            <div className="fpas_btn">
                <button className="btn btn-1"><ListIcon style={mystyle} /> Overview</button>
                <button className="btn btn-1"><ListIcon style={mystyle} /> ScreenShots</button>
                <button className="btn btn-1"><ListIcon style={mystyle} /> UserReviews</button>
                <button className="btn btn-1"><ListIcon style={mystyle} /> Prices</button>
            </div>

            <div className="fpas_papers">
                <Gridpapers />
            </div>
            
        </div>
    )
}

export default FindProductAndServives
